import React from "react"
import {
    VictoryBar,
    VictoryChart,
    VictoryAxis,
    VictoryTooltip,
    VictoryLine,
    VictoryGroup
} from "victory";
import { render } from "react-dom";
import data from "../components/Data/Data";

class AllStudentsGraph extends React.Component {
    constructor() {
        super()
    };


    render() {
        return (
            <VictoryChart>
                <VictoryBar
                    data={data}

                    x="enjoyability"
                    y="dificulty" />
            </VictoryChart>


        )
    }
};

export default AllStudentsGraph
